INSERT INTO `maids` VALUES ('0228c57b-e8ba-432c-8793-cf9874ed2237','3f8b5b34-4907-4480-86d5-3e43e72da1aa','สามารถทำงานในวันเสาร์-อาทิตย์และวันหยุดนักขัตฤกษ์ได้','I can work on Saturday and Sunday.','เคยทำรีเซฟชั่น โรงแรม','พนักงานบริษัท',5,2,NULL,0,NULL,'2017-07-31 22:16:12',NULL,'N','Y','Sunday,Saturday'),('02ba85a1-8445-4b46-8797-47b7bfa4bdd0','ae3e5087-94f4-4e27-9401-b98417728b88','ซื่อสัตย์ ขยันทำงาน ตรงต่อเวลา\r\nและพร้อมทำความเข้าใจกับประสบการณ์ใหม่ๆ','\r\nHonest, hard-working, punctual\r\nAnd understand new experiences.','รับออเดอร์/เสริฟ์\r\nพนักงานชงกาแฟ\r\nพนักงานขาย โทรศัพท์\r\nเคยงานผ่านที่เกี่ยวกับบริการลูกค้า\r\nยกเว้นแม่บ้านแต่ดิฉันพร้อมที่จะอบรม\r\n','Pool attendant',5,3,NULL,0,NULL,'2017-07-31 10:24:26',NULL,'N','Y','Tuesday,Thursday,Friday'),('07a99134-b672-4532-b536-c977571054f3','cbefab7e-c41c-4aa2-b7ab-4aa6939f0f03','สวัสดีค่ะ ดิฉันนางสาวอัญชลี ทรัพย์ทอง เป็นอีสานค่ะมาจาก จ.นครพนม เป็นตรงต่อเวลาค่ะขยันอนทน เป็นคนจิงใจเข้ากับคนง่ายพูดเก่นอัทยาสันดีค่ะ','Being a straight-forward, diligent, hard-working person with a good heart.','1.วิลล่า ชาบูล เป็นบ้านฟรั่ง วันหนึ่กก็ทำ 2 หลังเป็นอย่างตำค่ะ ทำอาหารเช้าด้วยค่ะ ถ้าแขกต้องการ\r\nเริ่มงานตั้งแต่ 1 มีนาคม 2557 ถึง 30 เมษายน 2558\r\nสาเหตุที่ออก ได้งานโรงแรมค่ะ\r\n2.รร ชบา บีส รีสอดร์ \r\nตั้งแต่ 10 พฤศภาคม  2558 ถึง 15 ธันวาคม 2559 แผนก แม่บ้','ว่างงานค่ะ',0,0,NULL,0,NULL,'2017-07-31 16:56:47',NULL,'Y','Y','Sunday,Monday,Tuesday,Wednesday,Thursday,Friday,Saturday'),('108ab0e1-d5eb-4c27-a3e3-7188afc9a01c','2ef8e74c-901b-407b-8f86-1d9390053bcd','ฉันสามารถทำงานคนเดียวได้\r\nด้วยความรวดเร็วและสะอาด','','ทำงานโรงแรม1ปี\r\nตอนนี้ทำpt ให้กับวิลล่า','ไม่มีงานประจำ รับแต่งานPT',5,3,NULL,0,NULL,'2017-07-26 23:57:29',NULL,'N','Y','Sunday,Monday,Tuesday,Wednesday'),('14b2f291-4c26-4c3f-ab15-9565312f0e26','9be25b00-98c9-4d45-980e-0fd1aa9b8a00','','','Loads','None toyota original',0,0,NULL,0,NULL,'2019-05-17 18:29:09',NULL,'N','N','Sunday,Monday,Tuesday,Wednesday,Thursday,Friday,Saturday'),('205c6cd8-ba49-4c35-9f2f